define("text!../partials/result.html",[],function(){return'<ion-view view-title="\u0420\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442" class="text-center">\n\n    <ion-content>\n        <div ng-if="result" \u0441lass="list">\n\n            <div class="item item-text-wrap" ng-bind="result.name"></div>\n\n            <div class="item item-divider">\n                \u0412\u0430\u0448 \u0442\u0438\u043f:\n            </div>\n            <div class="item item-text-wrap" ng-bind="result.personType.alias"></div>\n\n            <div class="item item-divider">\n                \u041e\u043f\u0438\u0441 \u043e\u0441\u043e\u0431\u0438\u0441\u0442\u043e\u0441\u0442\u0456:\n            </div>\n\n            <div class="item item-text-wrap" ng-bind="result.personType.description"></div>\n\n            <div class="item item-divider">\n                \u0424\u043e\u0440\u043c\u0443\u043b\u0430:\n            </div>\n            <div class="item item-text-wrap" ng-bind="result.formula"></div>\n\n            <div class="item item-divider">\n                \u0420\u043e\u0437\u0440\u0430\u0445\u0443\u043d\u043a\u0438:\n            </div>\n            <div class="item item-text-wrap result-table">\n\n                <div class="row">\n                    <div class="col col-25 section-label"><span>\u0428\u043a\u0430\u043b\u0430</span></div>\n\n                    <div class="col" ng-repeat="(groupKey, groupItemsSection) in result.groups">\n                        <span ng-bind="groupKey"></span>\n                    </div>\n                </div>\n\n                <div class="row">\n                    <div class="col col-25 top-none"></div>\n\n                    <div class="col" ng-repeat="sectionKey in sections">\n                        <span ng-bind="sectionKey"></span>\n                    </div>\n                </div>\n\n                <div class="row">\n                    <div class="col col-25">\u0411\u0430\u043b\u0438</div>\n\n                    <div class="col" ng-repeat="sectionKey in sections">\n                        <span ng-bind="result.totals[sectionKey]"></span>\n                    </div>\n                </div>\n\n\n                <div class="row">\n                    <div class="col col-25">Max</div>\n\n                    <div class="col" ng-repeat="sectionKey in sections">\n                        <span ng-bind="result.maxTotals[sectionKey]"></span>\n                    </div>\n                </div>\n\n\n                <div class="row">\n                    <div class="col col-25 label">% \u043e\u0442 Max</div>\n\n                    <div class="col value" ng-repeat="sectionKey in sections">\n                        <span ng-bind="result.fraction[sectionKey]"></span>\n                    </div>\n                </div>\n\n\n                <div class="row">\n                    <div class="col col-25 label"><span>\u041a\u043e\u0435\u0444\u0456</span><span>\u0446\u0456\u0454\u043d\u0442</span></div>\n\n                    <div class="col value" ng-repeat="(groupKey, groupItemsSection) in result.groups">\n                        <span ng-bind="result.coefficients[groupKey]" class="col-center"></span>\n                    </div>\n                </div>\n\n                <div class="row">\n                    <div class="col col-25 label"><span>% \u0432\u0438\u0440\u0430</span><span>\u0436\u0435\u043d\u043e\u0441\u0442\u0456</span></div>\n\n                    <div class="col value" ng-repeat="sectionKey in sections">\n                        <span ng-bind="result.expressions[sectionKey]"></span>\n                    </div>\n                </div>\n\n\n                <div class="row">\n                    <div class="col col-25 label"><span>\u0414\u043e\u043c\u0456</span><span>\u043d\u0443\u0454</span></div>\n\n                    <div class="col value" ng-repeat="(groupKey, groupItemsSection) in result.groups">\n                        <span ng-bind="result.dominants[groupKey]" class="col-center"></span>\n                    </div>\n                </div>\n\n\n                <div class="row">\n                    <div class="col col-25 label"><span>\u0412\u0438\u0440\u0430</span><span>\u0436\u0435\u043d\u0456\u0441\u0442\u044c</span></div>\n\n                    <div class="col value" ng-repeat="(groupKey, groupItemsSection) in result.groups">\n                        <span ng-show="result.isExpressed[groupKey]" class="col-center balanced">\u0422\u0430\u043a</span>\n                    </div>\n                </div>\n\n            </div>\n\n        </div>\n    </ion-content>\n</ion-view>'});
"use strict";
define("routes",["./app","text!../partials/home.html","text!../partials/login.html","text!../partials/test.html","text!../partials/result.html"],function(F,z,B,P,N){var q=function(q,F){F.otherwise("/");q.state("home",{url:"/",template:z,controller:"HomeController"}).state("login",{url:"/login",template:B,controller:"LoginController"}).state("test",{url:"/test/:questionId",template:P,controller:"TestController"}).state("result",{url:"/result",template:N,controller:"ResultController"})};q.$inject=["$stateProvider",
"$urlRouterProvider"];return F.config(q)});
